import React from 'react';
import 'bulma/css/bulma.css';

const Navbar = () => {
    return (
        // <nav className="navbar is-transparent">
        //     <div className="navbar-brand">
        //         <a className="navbar-item" href="https://bulma.io">
        //             <img src="https://bulma.io/images/bulma-logo.png" width="112" height="28" />
        //         </a>
        //     </div>

        //     <div id="navbarExampleTransparentExample" className="navbar-menu">
        //         <div className="navbar-start">
        //             <a className="navbar-item" href="https://bulma.io/">Home</a>s
        //         </div>

        //         <div className="navbar-end">
        //             <div className="navbar-item">
        //                 <div className="buttons">
        //                     <a className="button is-primary">
        //                         <strong>Sign up</strong>
        //                     </a>
        //                     <a className="button is-light">
        //                         Log in
        //   </a>
        //                 </div>
        //             </div>
        //         </div>
        //     </div>
        // </nav>
        <nav className="navbar is-transparent">
            <div className="navbar-brand">
                <a className="navbar-item" href="https://bulma.io">
                    <img src="https://bulma.io/images/bulma-logo.png" alt="Bulma: a modern CSS framework based on Flexbox" width="112" height="28" />
                </a>
                <div className="navbar-burger burger" data-target="navbarExampleTransparentExample">
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>

            <div id="navbarExampleTransparentExample" className="navbar-menu">
                <div className="navbar-start">
                    <a className="navbar-item" href="https://bulma.io/">Home</a>

                </div>

                <div className="navbar-end">
                    <div className="navbar-item">
                        <div className="field is-grouped">
                            <p className="control">
                                <CoolButton className="button is-rounded my-class is-danger ">Login </CoolButton>
                            </p>
                            <p className="control">
                                <CoolButton className="button is-rounded my-class is-success ">Signup</CoolButton>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </nav>
    )
}

export default Navbar
